import { useState, useEffect } from 'react';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { toast } from 'react-toastify';


export function EditarV({ buttonLabel, item, updateState, pedidoId }) {

    const [editedItem, setEditedItem] = useState(item);

    const onChange = (e) => {
        setEditedItem({
            ...editedItem,
            [e.target.name]: e.target.value
        });
    };

    const submitFormEdit = async (e) => {
        e.preventDefault();
        const params = {
            estado: e.target.estado.value,
            id_usuario: 1,
            nombre_cliente: e.target.nombre_cliente.value,
            factura_electronica: parseInt(e.target.factura_electronica.value),
            detalle_factura: e.target.detalle_factura.value,
            metodo_envio: e.target.metodo_envio.value,
            direccion_envio: e.target.direccion_envio.value,
            urgencia: e.target.urgencia.value,
            tipo_pedido: "Pedido"
        };

        fetch("https://AfigoControl.somee.com/API/api/pedido/update", {
            method: 'PUT',
            body: JSON.stringify(params),
            headers: {
                'Content-Type': "application/json; charset=utf-8",
                "Authorization": sessionStorage.getItem('Token')
            }
        })
        toast.success('Usuario actualizado con éxito', {
            position: 'top-right',
            autoClose: 3000, // Duración en milisegundos
            hideProgressBar: false,
        });

    };

    useEffect(() => {
        if (editedItem) {
            const { user_id, nombre, direccion, usuario_admin, nombre_de_usuario, contrasenia } = editedItem;
            setEditedItem({ user_id, nombre, direccion, usuario_admin, nombre_de_usuario, contrasenia });
        }
    }, [editedItem]);

    return (
        <section class="fixed top-40 left-1 w-full h-full flex flex-col items-center">
            <ToastContainer />
            <div class="min-w-[35%] bg-white p-1  flex flex-col shadow-[4px_10px_60px_800px_rgba(0,0,0,0.3)] rounded-xl" >
                <form onSubmit={submitFormEdit} class="grid">
                    <div class="flex flex-col m-4 w-full justify-center items-center">
                        <label class="font-semibold">Nombre del cliente</label>
                        <input class="border border-navy w-1/2"
                            value={editedItem.nombre_cliente}
                            onChange={(e) => setEditedItem({ ...editedItem, nombre_cliente: e.target.value })}></input>
                    </div>

                    <div class="flex flex-col m-4 w-full justify-center items-center">
                        <label class="font-semibold">Tipo de factura</label>
                        <select class="border border-navy w-1/2"
                            value={editedItem.factura_electronica}
                            onChange={(e) => setEditedItem({ ...editedItem, factura_electronica: e.target.value })}>
                            <option value={1}></option>
                            <option value={0}>Factura electronica</option>
                            <option value={1}>Factura fisica</option>
                        </select>
                    </div>

                    <div class="flex flex-col m-4 w-full justify-center items-center">
                        <label class="font-semibold">Informacion para factura</label>
                        <input class="border border-navy w-1/2"
                            value={editedItem.detalle_factura}
                            onChange={(e) => setEditedItem({ ...editedItem, detalle_factura: e.target.value })}></input>
                    </div>

                    <div class="flex flex-col m-4 w-full justify-center items-center">
                        <label class="font-semibold">Metodo de envio</label>
                        <select class="border border-navy w-1/2"
                            value={editedItem.metodo_envio}
                            onChange={(e) => setEditedItem({ ...editedItem, metodo_envio: e.target.value })}>
                            <option value=""></option>
                            <option value="Express">Express</option>
                            <option value="Encomienda">Encomienda</option>
                        </select>
                    </div>


                    <div class="flex flex-col m-4 w-full justify-center items-center">
                        <label class="font-semibold">Direccion</label>
                        <input class="border border-navy w-1/2"
                            value={editedItem.direccion_envio}
                            onChange={(e) => setEditedItem({ ...editedItem, direccion_envio: e.target.value })}></input>
                    </div>

                    <div class="flex flex-col m-4 w-full justify-center items-center">
                        <label class="font-semibold">Estado</label>
                        <select class="border border-navy w-1/2" value={editedItem.estado}
                            onChange={(e) => setEditedItem({ ...editedItem, estado: e.target.value })}>
                            <option value=""></option>
                            <option value="Leve">Pendiente</option>
                            <option value="Moderado">Listo</option>
                        </select>
                    </div>

                    <div class="flex flex-col m-4 w-full justify-center items-center">
                        <label class="font-semibold">Urgencia</label>
                        <select class="border border-navy w-1/2" value={editedItem.urgencia}
                            onChange={(e) => setEditedItem({ ...editedItem, urgencia: e.target.value })}>
                            <option value=""></option>
                            <option value="Leve">Leve</option>
                            <option value="Moderado">Moderado</option>
                            <option value="Urgente">Urgente</option>
                        </select>
                    </div>

                    <button type='submit' class="bg-navy text-white font-semibold p-3 pl-4 pr-4 mb-4 rounded-xl">Enviar</button>
                </form>

            </div>
        </section>

    );
}
